import numpy as np

def compute_features_fast(doc,n) :
    fv = np.zeros(n)
    numTokens = 0
    for token in doc :
        fv[look_up_token(token)] += 1
        numTokens += 1
    return fv/numTokens

def corpus_to_feature_matrix_fast(Corpus,n):
    fM = np.zeros((n,len(Corpus)))
    i  = 0
    for doc in Corpus :
        fM[:,i] = compute_features_fast(doc,n)
        i += 1
    return fM.T 

def look_up_token(token):
    if vocab['unknown_token_idx'] >= 0 :
        return vocab['token_to_idx'].get(token,vocab['unknown_token_idx'])
    else :
        return vocab['token_to_idx'][token]
    
